import React from 'react';
import './styles.css'; // Import the styles.css file

function App() {
  return (
    <div className="App">
      <header className="header">
        <nav className="navbar-container">
          <ul className="nav-list">
            <li className="nav-item"><a href="#findjobs">FindJobs</a></li>
            <li className="nav-item"><a href="#postjobs">PostJobs</a></li>
            <li className="nav-item"><a href="#resources">Resources</a></li>
          </ul>
          <a href="#join" className="join-button">Join Now</a>
        </nav>
      </header>

      <section className="hero-section">
        <div className="text-block">
          <h1>Dream Career</h1>
          <h2>Discover your perfect job match and leap into a world of endless opportunities</h2>
        </div>
      </section>

      {/* Other sections of your single page website */}
    </div>
  );
}

export default App;
